import { createRegister } from "../services/LoginServices";
import Swal from 'sweetalert2/dist/sweetalert2.js'
import 'sweetalert2/src/sweetalert2.scss'

const Users = async (state = [], action) => {
    console.log(state,action);
    
    switch (action.type) {
        case "CREATE_REGISTER":
            const result = await createRegister(action.info);
           
        default:
            return state;
    }

}
export default Users;
